import React, { useEffect, useState } from "react";
import axios from "axios";
import { Bar } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Tooltip,
  Legend
} from "chart.js";

ChartJS.register(CategoryScale, LinearScale, BarElement, Tooltip, Legend);

export default function FarmaciaDashboard() {
  const [dados, setDados] = useState({
    estoqueBaixo: [],
    proximosVencimentos: [],
    curvaConsumo: []
  });

  useEffect(() => {
    axios.get("http://localhost:8000/api/farmacia")
      .then(res => setDados(res.data))
      .catch(err => console.error(err));
  }, []);

  // ===================== CURVA DE CONSUMO (Top 5) =====================
  const curvaConsumoData = {
    labels: (dados.curvaConsumo || []).map(m => m.nome),
    datasets: [
      {
        label: "Estoque Atual",
        data: (dados.curvaConsumo || []).map(m => m.estoque),
        backgroundColor: "#1976d2"
      },
      {
        label: "Estoque Mínimo",
        data: (dados.curvaConsumo || []).map(m => m.estoque_minimo),
        backgroundColor: "#388e3c"
      }
    ]
  };

  return (
    <div style={{ padding: 20, maxWidth: 1100, margin: "auto" }}>
      <h1 style={{ textAlign: "center" }}>Dashboard Farmácia</h1>

      {/* ===================== ESTOQUE BAIXO ===================== */}
      <h3>Medicamentos com estoque baixo</h3>
      <table width="100%" border="1" cellPadding="8">
        <thead>
          <tr>
            <th>Nome</th>
            <th>Estoque</th>
            <th>Estoque Mínimo</th>
          </tr>
        </thead>
        <tbody>
          {(dados.estoqueBaixo || []).map(m => (
            <tr key={m.id}>
              <td>{m.nome}</td>
              <td>{m.estoque}</td>
              <td>{m.estoque_minimo}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* ===================== PRÓXIMOS E VENCIDOS ===================== */}
      <h3 style={{ marginTop: 30 }}>Medicamentos vencidos ou próximos do vencimento</h3>
      <table width="100%" border="1" cellPadding="8">
        <thead>
          <tr>
            <th>Nome</th>
            <th>Data de Vencimento</th>
            <th>Dias Restantes</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {(dados.proximosVencimentos || []).map(m => {
            const dias = Number(m.dias_restantes);
            const status = dias < 0 ? "Vencido" : "Próximo do vencimento";
            return (
              <tr key={m.id} style={{ color: dias < 0 ? "red" : "orange" }}>
                <td>{m.nome}</td>
                <td>{m.data_validade}</td>
                <td>{dias}</td>
                <td>{status}</td>
              </tr>
            );
          })}
        </tbody>
      </table>


      <h3 style={{ marginTop: 30 }}>Top 5 Medicamentos - Estoque e Estoque Mínimo</h3>
      <div style={{ height: 300 }}>
        <Bar
          data={curvaConsumoData}
          options={{
            responsive: true,
            plugins: { legend: { position: "top" } },
            scales: {
              y: {
                beginAtZero: true
              }
            }
          }}
        />
      </div>
    </div>
  );
}
